public void testMaxScore() throws Exception {
  // ask for all results
  TopDocsCollector<ScoreDoc> tdc = doSearch(15);
  TopDocs td = tdc.topDocs();
  assertEquals(MAX_SCORE, td.getMaxScore(), 0f);

  // ask for 5 last results
  tdc = doSearch(15);
  td = tdc.topDocs(10);
  assertEquals(MAX_SCORE, td.getMaxScore(), 0f);
}

